// frontend/src/components/Jobs.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Jobs = () => {
  const [jobs, setJobs] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchJobs();
  }, []);

  const fetchJobs = async () => {
    try {
      const response = await axios.get('http://localhost:8000/api/jobs/');
      setJobs(response.data.results || []);
    } catch (error) {
      console.error('Error fetching jobs:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleApply = async (jobId) => {
    try {
      await axios.post(`http://localhost:8000/api/jobs/${jobId}/apply/`, {
        cover_letter: 'I am interested in this position.'
      });
      alert('Application submitted successfully!');
    } catch (error) {
      if (error.response?.data?.error) {
        alert(error.response.data.error);
      } else {
        alert('Error submitting application. Please try again.');
      }
    }
  };

  if (loading) {
    return (
      <div className="min-h-screen bg-gray-50 flex items-center justify-center">
        <div className="animate-spin rounded-full h-16 w-16 border-b-2 border-green-600"></div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        <div className="mb-8">
          <h1 className="text-3xl font-bold text-gray-900">Job Opportunities</h1>
          <p className="mt-2 text-gray-600">Find your next career opportunity</p>
        </div>

        <div className="space-y-6">
          {jobs.map((job) => (
            <div key={job.id} className="bg-white rounded-xl shadow-sm p-6 hover:shadow-md transition-shadow">
              <div className="flex justify-between items-start">
                <div className="flex-1">
                  <div className="flex items-center space-x-3 mb-2">
                    <h3 className="text-xl font-semibold text-gray-900">{job.title}</h3>
                    {job.is_urgent && (
                      <span className="inline-flex items-center px-2 py-1 rounded-full text-xs font-medium bg-red-100 text-red-800">
                        Urgent
                      </span>
                    )}
                  </div>
                  
                  <p className="text-lg text-gray-700 mb-2">{job.startup_name}</p>
                  <p className="text-gray-600 mb-4">{job.description}</p>
                  
                  <div className="flex items-center space-x-4 mb-4">
                    <div className="flex items-center space-x-2">
                      <span className="text-gray-500">üìç</span>
                      <span className="text-sm text-gray-600">{job.location}</span>
                    </div>
                    <div className="flex items-center space-x-2">
                      <span className="text-gray-500">üí∞</span>
                      <span className="text-sm text-gray-600">{job.salary_range}</span>
                    </div>
                    <div className="flex items-center space-x-2">
                      <span className="text-gray-500">‚è∞</span>
                      <span className="text-sm text-gray-600">{job.posted_ago}</span>
                    </div>
                  </div>
                  
                  <div className="flex items-center space-x-2">
                    <span className="inline-flex items-center px-2 py-1 rounded-full text-xs font-medium bg-green-100 text-green-800">
                      {job.job_type_name}
                    </span>
                    <span className="inline-flex items-center px-2 py-1 rounded-full text-xs font-medium bg-blue-100 text-blue-800">
                      {job.experience_level}
                    </span>
                    {job.is_remote && (
                      <span className="inline-flex items-center px-2 py-1 rounded-full text-xs font-medium bg-purple-100 text-purple-800">
                        Remote
                      </span>
                    )}
                  </div>
                </div>
                
                <div className="ml-6">
                  <button
                    onClick={() => handleApply(job.id)}
                    disabled={job.has_applied}
                    className={`px-4 py-2 rounded-lg font-medium transition-colors ${
                      job.has_applied
                        ? 'bg-gray-100 text-gray-500 cursor-not-allowed'
                        : 'bg-blue-600 text-white hover:bg-blue-700'
                    }`}
                  >
                    {job.has_applied ? 'Applied' : 'Apply Now'}
                  </button>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Jobs;
